import React, { Component } from "react";

class Counter extends Component {
   state = {
      count: 0,
   };
   render() {
      return (
         <div>
            <h3>{this.state.count}</h3>
            <button style={{margin}}
               onClick={() => this.setState({ count: this.state.count + 1 })}update
            ></button>
         </div>
      );
   }
}

export default Counter;
